//************** Inits ***************

void PortE_Init(void){ uint32_t volatile delay;
	SYSCTL_RCGCGPIO_R |= 0x10;
	delay = SYSCTL_RCGCGPIO_R;
	GPIO_PORTE_DIR_R &= ~0x01; // bit 0 input
	GPIO_PORTE_AFSEL_R &= ~0x01;
	GPIO_PORTE_DEN_R |= 0x01;
}

