/****************ScoreDisplay*****************
Displays score next to cannon.
*/
void ScoreDisplay(void){
	ST7735_SetCursor(15,15);
	ST7735_OutUDec(score);
}

/****************MtDY and MtDX****************
These subroutines convert coordinates of bubbles
in the 'state matrix' to coordinates for the LCD
Inputs: matrix coordinates
Output: display coordinates
*/


int MtDY(int x, int y){return((y+n)*16+15);} //takes matrix coords and translates into display coords
int MtDX(int x, int y){
	if(y%2){return(x*16+8);}
	else{return(x*16);}
}

/********************Fall*********************
Called by Timer3A_Handler, this ISR updates the
position of falling bubbles as they fall down the screen.
*/

void Fall(void){
	if(fall1.fall_flag1==1){
		for(f=0 ; f < fall1.fallcount ; f++){
			fall1.y_arr[f]+=2;
		}
		cnt++;
		fall1.fall_flag2 = 1;
	}
}

/******************Aim************************
Called by Timer0A_Handler, this ISR updates the 
cannon position by reading values from the ADC
slide pot and displaying images accordingly.
*/
	
void Aim(void){
	CannonAim = ADC_In()/133;
}

/****************ProjectileSnap*****************
Once a bubble stops, this erases current bubble position 
and aligns bubble to the hexagonal grid, and it turns off 
flags to stop the bubble's movement.
*/

void ProjectileSnap(void){
	ST7735_DrawBitmap(ProjX, ProjY, black, 16, 16);
	WildX = ProjX;
	WildY = ProjY;
	YTemp = (ProjY-8)/16-n;
	if(YTemp%2){XTemp = ProjX/16;
		if(XTemp>6){XTemp = 6;}	}
	else{XTemp = (ProjX+8)/16;}
	ProjX = MtDX(XTemp, YTemp);
	ProjY = MtDY(XTemp, YTemp);
	ProjMoving = 0; 
	Collision = 0;
	shots++;
}

/*******************GameOverCheck********************
Checks to see if there are any bubbles in the 8th row,
if there are, game over.
Inputs: None
Outputs: None, updates global variable
*/
void GameOverCheck(){
	g=0;
	for(b=0;b<8;b++){
		if(Bubbles[7-n][b] != 0){g=1;}
	}
}

/*******************CollisionCheck*******************
This checks to see if a moving bubble has hit a bubble
or reached the end of the screen. 
*/

void CollisionCheck(void){
if(ProjY <=16*(1+n)){Collision = 1;}
int BubY, BubX;
for(BubY = 0; BubY <= 7; BubY++){
	for(BubX = 0; BubX <= 7; BubX++){
		if(Bubbles[BubY][BubX]){
			int DBubX = MtDX(BubX, BubY);
			int DBubY = MtDY(BubX, BubY);
			if((ProjX+2) <= DBubX+14 && (ProjX+2) >= DBubX+2 && (ProjY+14) <= DBubY+13 && (ProjY+14) >= DBubY+2){Collision = 1;}
			if((ProjX+14) <= DBubX+14 && (ProjX+14) >= DBubX+2 && (ProjY+14) <= DBubY+13 && (ProjY+14) >= DBubY+2){Collision = 1;}
			if((ProjX+2) <= DBubX+14 && (ProjX+2) >= DBubX+2 && (ProjY+2) <= DBubY+13 && (ProjY+2) >= DBubY+2){Collision = 1;}
			if((ProjX+14) <= DBubX+14 && (ProjX+14) >= DBubX+2 && (ProjY+2) <= DBubY+13 && (ProjY+2) >= DBubY+2){Collision = 1;}
			}	}	}	
}	

/*****************Projectile***********************
Called by the Timer1A_Handler, this ISR calculates 
projectile movement and takes care of bouncing off
the sides of the screen. 
*/

void Projectile(void){
	if(ProjMoving == 1){
		ProjCount++;
		ProjX = 56+(ProjCount*projectile[(ProjAim*2)]/100);			//calculates unmodified x value
		if(ProjX<0 && ProjX>=-112){ProjX *= -1;}								//For when x<0, 1 bounce
		if(ProjX<-112 && ProjX>=-224){ProjX += 224;}						//2 bounces
		if(ProjX<-224){ProjX = (ProjX+224)*-1;}									//3 bounces
		if(ProjX>112 && ProjX<=224){ProjX = (ProjX*-1)+224;}		//For when x>0, 1 bounce
		if(ProjX>224 && ProjX<=336){ProjX -= 224;}							//2 bounces
		if(ProjX>336){ProjX = (ProjX-224)-(ProjX-336);}					//3 bounces
		
		ProjY = 168-(ProjCount*projectile[(ProjAim*2+1)]/100);	//calculates unmodified y value
		
		CollisionCheck();
		ProjFlag = 1;
	}
}

/******************UpdateProjectile******************
Displays projectile as its position is updated by the 
Projectile ISR, also performs collision code if a collision 
is detected.
*/
	
void UpdateProjectile(void){
	if(ProjMoving == 1 && ProjFlag == 1){
		if(Collision == 1){
		ProjectileSnap(); 
		ST7735_DrawBitmap(ProjX, ProjY, (colorpt+256*(current-1)), 16, 16);
		Bubbles[YTemp][XTemp] = current;
		Display_Bubbles();
		if(current<7){Find_Clear(YTemp, XTemp);}
		else{SpecialBubblePerform();}
		ScoreDisplay();
		Bubbles_Update();
		Find_Fall();
		ScoreDisplay();
		GameOverCheck();
		ProjFlag = 0;
		}
		else {ST7735_DrawBitmap(ProjX, ProjY, (colorpt+256*(current-1)), 16, 16);}
}}

/*******************BubblesFall***********************
This subroutine displays the falling bubbles as their
positions are updated by the Fall ISR. Erases bubbles
aft er the falling is done.
*/

void BubblesFall(void){
			fall1.fall_flag2 = 0;
			for(f=0 ; f < fall1.fallcount ; f++){
				ST7735_DrawBitmap(fall1.x_arr[f], fall1.y_arr[f], (colorpt+256*(fall1.fallcolor[f]-1)), 16, 16);
				if(fall1.y_arr[f] > 111 || cnt>25){
					ST7735_DrawBitmap(fall1.x_arr[f], fall1.y_arr[f], black, 16, 16);
					for(b = f; b < fall1.fallcount; b++){
						fall1.y_arr[b] = fall1.y_arr[b+1];
						fall1.x_arr[b] = fall1.x_arr[b+1];
						fall1.fallcolor[b] = fall1.fallcolor[b+1];
					}
					f--;
					fall1.fallcount--;
				}
			}
			if(!(fall1.fallcount)){fall1.fall_flag1 = 0; cnt=0;}
}

/*******************CeilingCheck*********************
Checks to see if the ceiling should be dropped.
Inputs: None
Outputs: None
*/
void CeilingCheck(){
	if(shots > shotsmax){
		n++;
		shots=0;
		Display_Bubbles();
		ST7735_DrawBitmap(0, (n*16)-1, ceiling, 128, 16);
		Sound_CeilingDrop();
	}
}

/*******************LevelClear***********************
Checks if a level has been cleared. 
Inputs: None
Output: 1 if level is cleared, 0 if not cleared
*/

int8_t LevelClear(){
	int ret = 0;
	int i,j;
	for(i=0;i<8;i++){
		for(j=0;j<8;j++){
			if((Bubbles[i][j]) == 0){ret++;}}}
	if(ret == 64){return (1);}
	else{return(0);}
}

/*****************GameClear************************
Checks if the game is cleared.
Inputs: None
Output: 1 if game cleared, 0 if not cleared.
*/

int8_t GameClear(){
	if(Level > 12){//maximum level count
		return 1;
	}
	return 0;
}


