int main(void){
  TExaS_Init();  //various inits
  Random_Init(1);
	ST7735_InitR(INITR_REDTAB);
	PortE_Init();
	ADC_Init();
  Output_Init();
	fall1.fall_flag1=0; 
	fall1.fall_flag2=0;
	Timer0_Init(&Aim, 80000*33);
	Timer1_Init(&Projectile, 80000*17);
	Timer3_Init(&Fall, 80000*16);
	Sound_Init();
	
	while(1){//title screen loop, refreshes main menu buttons
		ST7735_FillScreen(0x0000);
		//Loads title screen
		ST7735_DrawBitmap(18, 35, Elemental, 92, 30);
		ST7735_DrawBitmap(26, 65, Baubles, 75, 30);
		
		int MainSelect = ADC_In()/1366;
		MainMenuButtonSelect(MainSelect);
		while((GPIO_PORTE_DATA_R & 0x01) == 0){
			MainSelect = ADC_In()/1366;
			if(MainSelect != CurrentSelection){
				Sound_ScrollClick();
				CurrentSelection = MainSelect;
				MainMenuButtonSelect(MainSelect);}}
		Sound_ButtonClick();
		while(GPIO_PORTE_DATA_R & 0x01){}
		ST7735_FillScreen(0);
		if(MainSelect == 0){PlayGame();}
		if(MainSelect == 1){HelpScreens();}
		if(MainSelect == 2){HighScoreRead();}
	}
}

/*****************Delay Subroutines*******************/

void Delay100ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){time--;}
    count--;}
}

void Delay10ms(uint32_t count){uint32_t volatile time;
  while(count>0){
    time = 72724;  // 0.01sec at 80 MHz
    while(time){time--;}
    count--;}
}
